imageDict = {}
krewesKeys = list(krewes.keys())
for i in range(len(krewesKeys)):
	imageDict[krewesKeys[i]] = imageList[i]

def chooseJob(krewes):
    percList = krewes.values()
    #print(percList)
    jobList = list(krewes)
    #print(jobList)
    return (random.choices(jobList, weights = (percList))[0])\

@app.route("/")
def rand_job():
    chosenJob = chooseJob(krewes)
    notJob = chooseJob(krewes)
    string = "<body>"
    string += "<h1>The Soup Sharks (James, Nada, Sadi) are proud to present: Your Miserable Future!!!</h1><br>"+ \
      "<h2>It looks like you got: " + str(chosenJob) + "</h2><br>"
    string += "<img src=" + imageDict[chosenJob] + " style=\"width:400px;height:300px;\">" 
    string += "<h2>Hey, could be worse. At least you didn't get: " + str(notJob) + "</h2><br>"
    if (chosenJob == notJob):
      string += "<h2>Oh, you did. Well... good luck with that.</h2><br>"
    string += "These were all the possibilities of your future, but not anymore:"
    string += "<br>" + str(krewes.keys())[11:len(str(krewes.keys()))-2]
    string += "</body>"

    return(string)

